copy a basic completer for simplicity cp -r completers/cp_completer completers/ln_completer update the package name in main.go replace root.go ln --help | caraparse -n ln > completers/ln_completer/cmd/root.go fix issues and add completions as required carapace.Gen(rootCmd).FlagCompletion(carapace.ActionMap{ "backup": carapace.ActionValues("existing", "nil", "none", "off", "numbered", "t", "simple", "never"), "target-directory": carapace.ActionDirectories(),
}) carapace.Gen(rootCmd).PositionalAnyCompletion( carapace.ActionFiles(""),
) run the generator once to add the new completer # cmd/carapace
go generate ./...
go install

