carascrape is a scraper for projects that use spf13/cobra . For most cases it is best to add a Run function to the root command. Then build and run the project. Generated source files are written to /tmp/carascrape##########/. import ( "github.com/rsteube/carapace-bin/pkg/carascrape"
) rootCmd := &cobra.Command{ Run: func(cmd *cobra.Command, args []string) { carascrape.Scrape(cmd) },
} asciicast
